print("Hi PeaceEngine2!")
print("Press joy stick or SDEF JIKL on keyboard")

numOfActions = 4
numOfMovements = 4
numOfHeroes = 3
currentMovement = 1
actionList = {"moveDown","moveLeft","moveUp","moveRight"}
heroes = {}
currentHero = 1

for k = 1, numOfHeroes do  
  hero = Actor:new({x=128,y=96-48/2})
  heroSprites = {}
  heroMovements = {}

  for j = 1, numOfMovements do 
    heroSprites[j] = {}
    for i=1, numOfActions do 
      heroSprites[j][i] = Sprite:new({tileHeight=48,height=48,tileWidth=32,width=32,x=(32*(i-1)),y=96,tileX=(32*(i-1))+(k-1)*128,tileY=(48*(j-1))})
    end 
    heroMovements[j] = Animation:new({sprites = heroSprites[j],frames = {8,8,8,8}})
  end 
  
  hero.actions = {moveDown=heroMovements[1],moveLeft=heroMovements[2],moveRight=heroMovements[3],moveUp=heroMovements[4]}
  hero:setAction("moveDown")
  
  table.insert(heroes,hero)
end

joystickOverlay = JoystickOverlay:new({x=216,y=96})

function updateHeroes()
  for k = 1, numOfHeroes do 
    heroes[k].x = heroes[currentHero].x
    heroes[k].y = heroes[currentHero].y
    heroes[k]:setAction(heroes[currentHero].currentActionName)
  end 
end 

function peUpdate()
  joystick = Joystick:new({states=getJoystickStates(0)})
  JoystickOverlay:update(joystick)
  --!important to update keyboard states after joystick!! 
  keyboardStates = getKeyboardStates()
  JoystickOverlay:updateFromKeyStates(keyboardStates,true)
  
  if joystick:isX() or keyboardStates[getScancodeFromName("J")] then 
    setBackgroundColor(0x1f,0xaa,0xb9)
  end 
  if joystick:isY() or keyboardStates[getScancodeFromName("I")] then 
    setBackgroundColor(0xe5,0xfa,0x89)
  end 
  if joystick:isA() or keyboardStates[getScancodeFromName("K")] then 
    setBackgroundColor(0x7e,0xd9,0x77)
  end 
  if joystick:isB() or keyboardStates[getScancodeFromName("L")] then 
    setBackgroundColor(0xff,0x9e,0x84)
  end 
  if joystick:isStart() or keyboardStates[getScancodeFromName("Return")] then 
    setBackgroundColor(0xbb,0xcc,0xff)
    updateHeroes()
    currentHero = 1
  end 
  if joystick:isLB() or keyboardStates[getScancodeFromName("Z")] then 
    updateHeroes()
    currentHero = 2
  end 
  if joystick:isRB() or keyboardStates[getScancodeFromName("/")] then 
    updateHeroes()
    currentHero = 3
  end 
  if joystick:isRight() or keyboardStates[getScancodeFromName("F")] then 
    heroes[currentHero].x = heroes[currentHero].x +1 
    heroes[currentHero]:setAction("moveRight")
  end 
  if joystick:isLeft() or keyboardStates[getScancodeFromName("S")] then 
    heroes[currentHero].x = heroes[currentHero].x -1 
    heroes[currentHero]:setAction("moveLeft")
  end 
  if joystick:isUp() or keyboardStates[getScancodeFromName("E")] then 
    heroes[currentHero].y = heroes[currentHero].y -1 
    heroes[currentHero]:setAction("moveUp")
  end 
  if joystick:isDown() or keyboardStates[getScancodeFromName("D")] then 
    heroes[currentHero].y = heroes[currentHero].y +1 
    heroes[currentHero]:setAction("moveDown")
  end 
  
  if joystick.states[1] == 0 and not (keyboardStates[getScancodeFromName("D")] or keyboardStates[getScancodeFromName("S")] or keyboardStates[getScancodeFromName("E")] or keyboardStates[getScancodeFromName("F")]) then 
    heroes[currentHero]:setAnimate(false,true)
  else 
    heroes[currentHero]:setAnimate(true)
  end 
end 

function peRender()
  heroes[currentHero]:draw()
  joystickOverlay:draw()
end 





